script: |
  super -f text -I q8611.spq | sort > q8611.out

inputs:
  - name: q8611.spq
    data: |
      SELECT + col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT 81 IN ( + + col0 + + - col2, + col0, - - col0 / + - 66 - + col1 + col0 * + - col0 );
  - name: tab0

outputs:
  - name: q8611.out
    data: |
      10
      47
      99
